import React from "react";
import { Avatar, Typography, Button } from "antd";
import styled from "styled-components";

const StyleUserInfo = styled.div`
  display: flex;
  justify-content: space-between;
  padding: 32px 20px;
  gap: 2em;
  border-bottom: 1px solid #ccc;
`;

const StyleAvatar = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: center;
  gap: 10px;
  &&& {
    .btn-logout {
      background-color: #391898;
    }
  }
`;
const UserInfo = () => {
  return (
    <StyleUserInfo>
      <StyleAvatar>
        <Avatar
          src={
            "https://lh3.googleusercontent.com/EKuPEsJM8-396Cqn…UzxQuSF5wF_-I0L7xhJY1sSqw=w624-h933-no?authuser=3"
          }
          size="large"
        />
        <Typography.Text>Nguyệt Quỳnh</Typography.Text>
      </StyleAvatar>
      <Button type="primary" className="btn-logout">
        Đăng xuất
      </Button>
    </StyleUserInfo>
  );
};

export default UserInfo;
